import React from 'react';
import logo from './logo.svg';
import './App.css';
import Autocomplete from 'react-autocomplete'
import { Row, Col, FormGroup, Label, Input , UncontrolledDropdown, DropdownToggle, DropdownMenu, DropdownItem , Button} from "reactstrap";

class App extends React.Component{
  constructor(props) {
    super(props);
    this.state = {
      userName : "",
      usersList : [],
      users : [],
      user : {
                avatar_url : "https://github.com/images/error/octocat_happy.gif",
                location : "",
                email : "",
                bio : "",
                url : "",
                public_repos : "",
                followers : ""
              }
    }

    this.getUserProfile = this.getUserProfile.bind(this);
    this.getUsersList = this.getUsersList.bind(this);
  }

  getUserProfile(event, value) {
    let usersData = this.state.users;
    this.setState({userName : value.name});

    fetch("https://api.github.com/users/"+value.name+"?token=0bc67222f789bad75c311425bea5358617b6ed8e")
    .then(result => result.json()).then(user => {
      // console.log("data",data);
      this.setState({user : user})
    })
    // console.log("value", user);
  }

  getUsersList(event, value) {
    this.setState({userName:value}, function(){
        if(value == ""){
          this.setState({usersList : []});
        }
        fetch("https://api.github.com/users")
        .then(results => results.json()).then(data => {
          let usersData = data.filter(user => !user.login.indexOf(value));
          let users = usersData.map(function(user) {
              return ({name : user.login, id : user.id});
            });
          this.setState({usersList : users, users : usersData});
          // console.log(users);
        })
      }
    );
  }

  render() {
    return (
      <div className="App">
        <header className = "App-header">
          <Row className = "Header-row">
            <Col>
              <Label>Username : </Label>
              <Autocomplete value = {this.state.userName}
                            items = {this.state.usersList}
                            onChange = {(event, value) => {
                              this.getUsersList(event, value)
                            }}
                            onSelect = {(event, value) => {
                              this.getUserProfile(event, value)
                            }}
                            getItemValue={(item) => item.name}
                            renderItem={(item, isHighlighted) => (
                      		            <div
                      		              className = "App-autoComplete"
                                        key={item.id}>{item.name}</div>
                      		          )}
                            >
              </Autocomplete>
              <Button className = "App-button" onClick = {this.getUserProfile}>Submit</Button>
              <div style = {{'textAlign' : 'right'}}>
                <img src={this.state.user.avatar} className="App-logo" alt="logo" />
              </div>
            </Col>
          </Row>
        </header>

        <FormGroup className = "App-body">
          <Row>
            <Col>
              <h2>User Profile</h2>
            </Col>
          </Row>

          <Row className = "App-row">
            <Col>
              <Label>Location : </Label>
              <Label>{this.state.user.location}</Label>
            </Col>
          </Row>

          <Row className = "App-row">
            <Col>
              <Label>Email : </Label>
              <Label>{this.state.email}</Label>
            </Col>
          </Row>

          <Row className = "App-row">
            <Col>
              <Label>Bio : </Label>
              <Label>{this.state.bio}</Label>
            </Col>
          </Row>

          <Row className = "App-row">
            <Col>
              <Label>Profile link : </Label>
              <Label>{this.state.profileLink}</Label>
            </Col>
          </Row>

          <Row className = "App-row">
            <Col>
              <Label>Total Number of Starred Repo's : </Label>
              <Label>{this.state.totalRepos}</Label>
            </Col>
          </Row>

          <Row className = "App-row">
            <Col>
              <Label>Followers : </Label>
              <Label>{this.state.followers}</Label>
            </Col>
          </Row>

        </FormGroup>
      </div>
    );
  }
}

export default App;
